INSERT INTO `location_descriptions` VALUES (20,'Rotating menu of world cuisine, sushi, and grab-n-go sandwiches, wraps and salads','\n<p>Step into a world of good at Pangea. Our daily, all-you-care-to-eat menu of international cuisine brings you along on journeys to Italy, BBQ, Mexico, and China. Until you get there, try it here. </p>\n <p>Nourish your appetite for travel at any of our 10 serving stations Monday through Thursday, and then treat yourself to a decadent, all-you-care-to-eat Vegas-style Brunch on Fridays.</p>\n <p>Survey ahead of time some of our possible dishes below or browse today\'s <strong><a href=\"../menu.php?unit=pangea\" rel=\"shadowbox;height=500;width=600\">menu</a></strong> to see what\'s being served now. Gluten Free, Vegetarian and Vegan options are also available. </p>\n <p><strong>SERVING STATIONS</strong></p>\n <ul>\n <li><strong>Skizza</strong> - Fresh-baked flatbreads and pizzas with only the finest toppings</li>\n <li><strong>Food Frenzy</strong> - Rotating World Menu </li>\n <li><strong>Viva Mexico </strong> - Enjoy our traditional Mexican dishes from tacos, enchiladas, guacamole, carne asada and more </li>\n <li><strong>Veggie Bites</strong> - Heirloom tomato salad, panzanella, lucy\'s pasta salad, southwest bean salad, or Caesar salad </li>\n <li><strong>Between the Bread</strong> - Freshly warmed and sliced artisan bread adds to any meal</li>\n <li><strong>Mangia Italia</strong> - Be sure to leave ample space in your belly to enjoy these amazing dishes: marguerita pizza, pasta, lasagna, and more</li>\n <li><strong>Sweet Buzz</strong> - Dairy- and gluten-free Shot glass desserts, cannolis, cookies, cakes, or parfaits</li>\n <li><strong>Swirl</strong> - Your classic chocolate and vanilla frozen yogurt with toppings till you drop</li>\n <li><strong>Ready, Set, Cook</strong> - Fresh-cooked noodles bathed in vegetarian miso or pork broth with your choice of gobo roots, chicken, bean sprouts, jalape&ntilde;o peppers, and salty seaweed mix</li>\n <li><strong>Wet Your Whistle</strong> - Hydration station fully equipped with fountain drinks, juices, and teas</li>\n <li><strong>Backyard BBQ</strong> - Comfort food you can enjoy daily: mashed potatoes, gravy, pulled pork, corn bread and more</li>\n </ul>\n <br><br>\n <p><strong>FRIDAY\'s VEGAS-STYLE BRUNCH</strong></p>\n <p>Former MGM Grand innovator and UA Executive Chef Michael Omo brings his Las Vegas-style brunch. Reward yourself with delicious meals from any of our serving stations:</p>\n <ul>\n <li><strong>Pancake Station</strong> - Choose from whole wheat waffle mix or pancake mix and add in chocolate chips and sprinkles, peanuts, Butterfinger&reg; bits, caramelized almonds, bananas, blueberries, cranberries, M&amp;M&reg; pieces, blueberry and strawberry syrup, and sweet strawberry sauce</li>\n <li><strong>Hot Food Line</strong> - Blintzes, applewood sausage, corn beef hash, breakfast potatoes, biscuits &amp; gravy, or pork osso bucco</li>\n <li><strong>Omelet Station</strong> - Mix up your own whole-egg or egg-white omelet with cheddar cheese, fresh spinach, diced ham and bacon, green onions, or salsa</li>\n <li><strong>Salad Bar</strong> - Caesar salad, Lucy\'s pasta, tomato &amp; mozzarella salad, and Jell-O&reg; salad served with your choice of dressings and condiments</li>\n </ul>\n\n',NULL),(57,'Energy drinks, power bars and grocery items','<p><b>Need energy?</b> Get positively charged at Boost, located on the main level of the Student Union Memorial Center across from Great Clips. Grab an energy drink or power bar from our large selection. Other convenience items are also available.</p>',NULL),(2,'Burgers and fries ','<p>Located in the first level food court, <a href=\"http://www.burgerking.com/\">Burger King</a> brings to the Student Union their famous hamburgers including favorites such as the \"Whopper,\" as well as breakfast items, sundaes, fresh baked pies, and french fries.</p>',NULL),(5,'Serving breakfast, lunch, and dinner. Coming this fall, sushi and BBQ','<p>Located on the third level of the Student Union, Cactus Grill offers a wide variety of choices from hot breakfast, lunch & dinner entrees, soups, grilled sandwiches, stir-fry bowls, BBQ, extensive salad bar and made to order sushi.</p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(21,'Full service modern Mexican cuisine','<p> <p>Sabors menu brings you fresh, fast Mexican flavors with our fare. Located in the main level of the SUMC, Sabor has a wide variety of entrees from Taco Salads to burritos and tacos. Come in and try on of our weekly specials or grab a Mexican dessert. - <b>all for under $8.</b></p> <ul> <li>Burrito with Baja Chicken, Fajitas Steak, or Tequila Lime Pork</li><li>Quesadilla with Baja Chicken or Cheese</li><li>Taco Salad with Baja Chicken, Spicy Beef, or Tequila Lime Pork</li><li>2 Tacos with Baja Chicken, Fajitas Steak, or Tequila Lime Pork</li><li>2 Enchiladas with Baja Chicken or Cheese</li></ul><br><p>Whether you are catching your morning lecture or heading to class in the afternoon, grab one of our breakfast burritos served from open until close for just $5 and get to class with some good in you.</p><p>Taste any of our new Value Menu items for a quick, convenient bite:</p><ul><li>Egg and Chorizo Burrito</li><li>Egg, Cheese and Salsa Burrito</li><li>Spicy Cheese Nachos</li><li>2 Chicken or Spicy Ground Beef Tacos</li><li>1/2 lb. Bean and Cheese Burrito</li><li>2 Taquitos</li></ul></p><br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(62,'Freshly baked pastries,  sweet and savory crepes, fruit smoothies, and coffee and espresso. ','\n<p>Fresh French pastries, sweet and savory crepes, smoothies, coffee and espresso in an easy to-go environment perfect for students in a rush between classes. </p>\n \n<p><strong>\nSkip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up</u></a>. Use your smartphone to order and pay ahead.\n<br />\nSave a trip with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you.\n</strong></p>\n',NULL),(22,'A Shamrock Farms Creamery: Ice Cream, Sundae Fundays, Ice cold from the Fridge, Speical tea','\n\n 		   <p>Brrrr down on some delicious hand-dipped ice cream. Add protein-packed shakes and  Rockin\' Refuel to your workout routine. Or power through English Lit with a Shamrock Farms Cold Brew Coffee and Milk. All made with the purest, freshest  milk from Shamrock Farms.</p>\n 		    <p>Of course, The Scoop is more  than a creamery. It\'s a great place to get together with friends and just hang  out.</p>\n 		    <p>So next time you need to  perk up, chill out or rock on, meet up at The Scoop, in the student union.</p>\n\n',NULL),(74,'Nutrient Rich options including fresh juices, seasonal produce & ground nut butter','<p>Nutrient Rich & Delicious is what the N<sup>RICH</sup> Urban Market offers. N<sup>RICH</sup> your palate with fresh pressed juices, seasonal produce, freshly ground nut butters, infused waters, brewed tea & botanicals, probiotic rich frozen yogurt, and grab n\' go meals & snacks. Stop in for a health break, see our vertical garden and learn about our delicious options (located in the Food Court of SUMC).</p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(23,'Open late, this sports-themed restaurant offers the optimal fan experience.','\n<p>Cheer on the Wildcats in the coziest cellar you\'ve ever seen. Open late and even Sundays, this energizing, sports-themed restaurant in the Student Union\'s lower level offers the optimal fan experience. Wildcat games and NFL Sunday Ticket play across nine wide-screen TVs, and a jumbo screen plays a projection of the big game.</p>\n <p>Feast on unique options like signature burgers, chicken Caesar salad, nachos, beer-battered onion rings, and sweet potato fries. Wash it all down with a drink from the Coca-Cola Freestyle fountain dispenser-the highest-tech soda machine available on campus. Or select one of our hand-made shakes blended with real ice cream and unique combinations like Oreo&reg;, apple pie, cheesecake, macchiato, pi&ntilde;a colada, along with the traditional chocolate, strawberry and vanilla.</p>\n \n<p><strong>\nSkip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up</u></a>. Use your smartphone to order and pay ahead.\n<br />\nSave a trip with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you.\n</strong></p>\n',NULL),(70,'Menu to be added soon!','<p>Menu to be added soon!</p>',NULL),(24,'Chick-fil-A combos, fresh squeezed lemonade and desserts','<p>Every day, Chick-fil-A prepares the highest-quality food because we use only the freshest ingredients. Our hand-breaded, all-breast-meat chicken is cooked in 100% refined peanut oil, which is naturally trans fat-free and cholesterol-free. You can taste the crispness of the vegetables in our freshly prepared salads and wraps. We even brew our delicious Iced Tea and freshly squeeze our Lemonade every day. <br /><br /> Chick-fil-A catering is the easy and delicious choice for every occasion. See our <a href=\"/dining/template/resources/Chick-Fil-A_Catering.pdf\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>CATERING MENU</u></a>.</p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(1,'Create your own salad','<p>Welcome to Core (located in SUMC Food Court next to On Deck Deli), one of the many healthy dining options on campus! It is our mission to provide food your body loves: to always offer healthy, tasty and unique options that meet your needs. </p> <p>At Core, you will find healthy, custom built salads, vegetables, fruits, vegan options, and all a variety of bottle beverages.</p>  <p>Here is how Core works: <br /> You decide what you want in your salad by selecting from over 120 fresh ingredients. All salads are made fresh and to your specifications (you select the ingredients, toppings and dressings). Here is the dressing list (subject to change): balsamic vinaigrette, blue cheese, caesar, sesame ginger, creamy pepper & parmesan, Italian, Italian (low carb), lemon garlic, lime cilantro vinaigrette, oil & vinegar, poppy seed, ranch, fat free ranch, raspberry vinaigrette, honey mustard, thousand island, and tomato basil vinaigrette. </p> <p> There are literally billions of possible ways to have a salad made at Core. You can also select from over 40 vegetables and have them steamed over brown rice at SUMC, or folded into a quesadilla at PSU. So why wait? Grab some food your body loves at Core today </p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(27,'Wraps, salads, smoothies','<p>You are what you eat. Show your Mensa-level mental capacity by picking up some IQ smoothies, fresh salads, acai bowls and wraps at IQ Fresh. Stop by IQ Fresh located in the Food Court of SUMC for a refreshing meal or snack today.</p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(28,'Custom sandwiches and bagels','<p> At On Deck Deli (located in the Food Court of SUMC) you can find plenty of choices to create your favorite sandwich, from a large variety of breads, meats, cheeses and vegetables not to mention all the different spreads. Get it cold or toasted, with a soup or chips... You can also make it a salad instead of a sandwich. Even better make it a combo!</p> <p>&nbsp;</p> <p> <!--  <div align = \"center\">  <a href=\"/thanksgiving/index.php\"><img src=\"/dining/template/images/thanksgiving_order.jpg\" width=\"358\" height=\"358\" alt= \"Order Thanksgiving Feast To-Go\" text= \"Order Thanksgiving Offerings To-Go\" /></a>  </div> --> <!--Skip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up and Delivery</u></a>. Use your smartphone to order and pay ahead.--> </p>   <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(29,'Gourmet chinese food','<p><a target=\"_blank\" href=\"http://www.pandaexpress.com\">Panda Express</a> brings a unique new element to the Student Union food court. Enjoy gourmet Chinese food including such popular entrees as Orange Flavored Chicken, Sweet and Sour Chicken, and Beef and Broccoli. Combinations include choice of rice or chow mein and an authentic fortune cookie.  Plenty of seating is provided in the food court area, as well as the outside patio.</p>',NULL),(26,'Pizza and salads','<p>One of the nation\'s most popular pizzas - right here on campus!</p>\r\n<p>At <a target=\"_blank\" href=\"http://www.papajohns.com/\">Papa John\'s</a>, you can enjoy pizza by the slice or by the pie, as well as breadsticks and a wide variety of salads.</p>\r\n<p>Get your pizza at our location in the Student Union Memorial Center, or get it at the Speedway location that delivers and also accepts catcard.</p>',NULL),(30,'Rotating menu buffet with some of the best views on campus','\n<p>Occupying the former Redington Restaurant space (3rd fl., SUMC), Arizona Room combines an elegant, relaxed setting with some of the best views on campus. Students and staff will enjoy the new buffet-style dining menu with an added emphasis on table service.</p>\n<p>&nbsp;</p>\n',NULL),(32,'Located in the UA BookStores','<p>How would students study without coffee? No one knows. Since 1971, Starbucks Coffee Company has been committed to ethically sourcing and roasting the highest-quality arabica coffee in the world. Today, with stores around the globe, the company is the premier roaster and retailer of specialty coffee in the world. Our Student Union locations follow Starbucks mission statement To inspire and nurture the human spirit  one person, one cup and one neighborhood at a time</p><br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ','Window pick up through Grub Hub only'),(31,'Campus convenience store offering groceries, grab-n-go sandwiches, snacks, frozen yogurt and eegee\'s frozen drinks','<p>You can find a wide variety of convenience items at Arizona Market as well as groceries, pre-wrapped sandwiches, frozen dinners, candy, ice cream, Eegee\'s frozen ices, and cold drinks.</p> <p>&nbsp;</p> <p>Now located next to the Canyon on the main level of SUMC.</p> <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(35,'Features a large selection of gourmet bagels, cream cheese, breakfast bagel sandwiches, and piping hot coffee','\n<p>Features a large selection of gourmet bagels, cream cheese, breakfast bagel sandwiches, and piping hot coffee.</p>\n \n<p><strong>\nSkip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up</u></a>. Use your smartphone to order and pay ahead.\n<br />\nSave a trip with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you.\n</strong></p>\n',NULL),(36,'pizza and salads','<p>One of the nation\'s most popular pizzas - right here on campus!</p>\r\n<p>At <a target=\"_blank\" href=\"http://www.papajohns.com/\">Papa John\'s</a>, you can enjoy pizza by the slice or by the pie, as well as breadsticks and a wide variety of salads.</p>\r\n<p>Two campus locations including the Student Union Memorial Center in the lower level Park Avenue Market next to McDonalds, and the newly renovated Park Student Union.</p>',NULL),(37,'Choose from select international grocery options, Red & Blue house made favorites and snacks, dorm room staple groceries and a special Ramen making machine.','Located on the main level of Global Center.  Choose from select international grocery options, Red & Blue house made favorites and snacks, dorm room staple groceries and a special Ramen making machine.',NULL),(65,'Within walking distance of many of the UA residence halls on the West side of campus, enjoy a full breakfast, pasta, salads, burgers, variety of homemade entrees, and deli-style sandwiches.','\r\n\r\n<p>Within walking distance of many of the UA residence halls on the West side of campus, enjoy a full breakfast, pasta, salads, burgers, variety of homemade entrees, and deli-style sandwiches.\r\n</p>\r\n\r\n<!--\r\n<img style=\"margin-top: 10px\" src=\"/template/images/ads/Thanksgiving_web.jpg\"/>\r\n-->',NULL),(38,'Core is designed to offer healthy, tasty and unique food options, as well as gluten-free choices, that meet your needs','<p>Core is designed to offer healthy, tasty and unique food options, as well as gluten-free choices, that meet your needs.</p>   <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(60,'frozen yogurt, breakfast yogurt and custom trail mix','<p>Located in the Cactus Grill on the third floor of the Student Union Memorial Center and also in Umart, Fro-Yo serves your choice of frozen yogurt flavor along with a wide variety of yummy goodies to top it off. Enjoy customizing breakfast yogurt and trail mix as well as a fro-yo flurry.',NULL),(42,' ','<p style=\"margin-top: 10px;\" ><strong>On the corner of sixth and Highland, next to El Portal and across from the Rec Center.</strong></p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(41,' ','\n<p>Located just under the McClelland Hall. The Counter allows you to make your own sandwich with a great variety of breads, meats, cheeses, and condiments. The Counter also offers a diversified option of sides, drinks, and desserts. They offer delivery.</p>\n<p><strong>\nSkip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up</u></a>. Use your smartphone to order and pay ahead.\n</strong></p>\n',NULL),(61,'Fresh salads, sandwiches, wraps, flatbreads, smoothies and frozen yogurt. Fuel up for the gym with our espresso and electrolyte water bar. Located at the Student Rec Center.','\n<p style=\"line-height:20px;\"><i>\nFuel is a modern eatery located inside the Campus Recreation building. Fuel feeds hungry Wildcats healthy way! Using the Eat Like a CHAMP<sup>TM</sup> program, Fuel offers nutrient dense foods designed a winning performance.  Choose from fresh delicious flatbreads, salads, wraps, power bowls, and hand crafted smoothies. Fuel also provides many options for hydration with the largest selection of sport drinks tailored for your workout style along with many other beverages including Vitamin Water and soy milk.\n</i></p>\n \n <p><strong>\n Skip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up</u></a>. Use your smartphone to order and pay ahead.\n <br />\n Save a trip with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you.\n </strong></p>\n',NULL),(44,'McClelland',NULL,NULL),(43,'McKale','',NULL),(47,' ','\n<img src=\"/dining/template/images/CatalystCafe/long_desc.jpg\" style=\"margin-top:45px; margin-bottom:65px; width: 100%;\">\n',NULL),(46,'USA','',NULL),(66,'Swirly goodness, the original tart frozen yogurt known for its taste and highest quality ingredients','\n<p><a href=\"http://pinkberry.com\" target=\"_blank\">Pinkberry</a>, the L.A. tart frozen yogurt brand, is making the UA home to swirly goodness. As the only Pinkberry in Arizona, the Union location serves six distinctive flavors: Original, Pomegranate, Salted Caramel, Chocolate, Mango, and a featured flavor that rotates seasonally. Customers can personalize every yogurt experience at Pinkberry with any combination of fresh, delicious toppings.\n<br /><br /> \nWe Cater, for more information, please call store.</p>\n',NULL),(67,'Everything from bagels to sandwiches and more','\n<p>We are proud to provide our guests with freshly baked bagels, breakfast sandwiches, lunch sandwiches, coffee, catering and so much more. Stop on in. We will have a fresh bagel and cup of coffee ready for you. <br /><br /> \n\n<p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> \n',NULL),(68,'Bear Down Kitchen','\n\n Located inside Arizona Stadium\'s new Lowell-Stevens football facility, Bear Down Kitchen not only serves as the training table for UA athletes, it\'s open to the public! \n Offering buffet-style options, and made-to-order breakfast and lunch, a pizza oven, salad bar, and panoramic field views, Bear Down Kitchen provides an all-you-care-to eat experience like few in the nation. You may even run into your favorite student athlete and coach!\n',NULL),(75,'Premium burgers and shakes','<p> Steak \'n Shake, a classic American brand, serves premium burgers and shakes in 600 restaurants across the country and the world. Founded in 1934 in Normal, Illinois, Steak \'n Shake is the leader in the \"better burger\" segment of the restaurant industry, serving hand-crafted, premium Steakburgers and hand-scooped milkshakes. Steak \'n Shake is the recipient of the Nation\'s Restaurant News Golden Chain Award. Zagat has recognized Steak \'n Shake as having the No. 1 Milkshake. Steak \'n Shake Inc. is a wholly owned subsidiary of Biglari Holdings Inc. </p> ',NULL),(86,'Enjoy a rotating menu of authentic Indian favorites. ','Enjoy a rotating menu of authentic Indian favorites.  Appetizers include Vegetable Samosas and Dahi Kabab.  Entrees include dishes such as Chicken Tikka, Chana Masala and Saag with Basmati Rice.  Vegetarian and meat based options are available each day.',NULL),(76,' ',' ',NULL),(45,'Located near the library.','<p>How would students study without coffee? No one knows. Since 1971, Starbucks Coffee Company has been committed to ethically sourcing and roasting the highest-quality arabica coffee in the world. Today, with stores around the globe, the company is the premier roaster and retailer of specialty coffee in the world. Our Student Union locations follow Starbucks mission statement To inspire and nurture the human spirit  one person, one cup and one neighborhood at a time</p><br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(69,'Located in the new ENR2 building, Slot Canyon Caf is the perfect place to relax and refresh between classes as you take in the sureeness of the lounge area. Grab a cup of coffee or tea, or satisfy your hunger with a variety of Red & Blue Market items, hot sandwiches, salads, soups, snacks and desserts.','',NULL),(71,'Grubhub PickUp and Delivery available.','\n<p><strong>\nSkip the line with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Express Pick Up</u></a>. Use your smartphone to order and pay ahead.\n<br />\nSave a trip with <a href=\"http://www.tapingo.com\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>Tapingo Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you.\n</strong></p>\n',NULL),(72,'Grubhub PickUp and Delivery available.','<p><br /> Yep! Breakfast all day! Also featuring Hand Smashed burgers, sandwiches, burritos and more. Don\'t forget to try our Hand Dipped Spun milkshakes! </p>  <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(73,' ','<p>Menu Updated!</p>',NULL),(78,' ','\n<p>Ike\'s Coffee and Marketplace is an extension of the longstanding Ike\'s Coffee and Tea based in the downtown Tucson. With a full service barista station all patrons can order custom roasted single origin coffee drinks. Ike\'s has a longstanding relationship with one of the USA\'s premier specialty coffee-bean importers. The importer has strong family connections with the roasters of Ike\'s coffee and the three way relationship produces some of the finest coffee to be found. Everything from Espresso to Nitro Cold Brew is offered and all drinks prepared just like you want them. In addition to this Ike\'s offers cold shakes and smoothies to fend off the Tucson heat!</p>\n\n<p>Ike\'s also offers fresh prepared salads with their own custom dressings and both hot and cold sandwiches prepared just as you like it. There are Vegan, Vegetarian and Gluten friendly options. For snacks and treats there are fresh baked croissants, beagles, muffins, freshly made parfait\'s - there is always an offering of Gluten friendly treats for those who are Gluten intolerant. In addition to this, Ike\'s has added a small marketplace component with many convenience store items available to grab and go offering protein bars, trail mix, nuts etc as well as  traditional candies and soda.</p>\n\n<p>Ike\'s Coffee is a local Tucson family owned business and is proud to serve the University of Arizona academic community. Ike\'s major focus is fresh and nutritional offerings served quickly with a friendly simile.</p>\n\n',NULL),(77,' ','\n<p>\nShake Smart specializes in freshly blended protein shakes, organic acai bowls, organic peanut butter and banana sandwiches, oatmeal, coldbrew coffee, whole wheat wraps, and kombucha on tap. A perfect option for before or after workouts, or for the college on-the-go lifestyle, Shake Smart was created by students, for students. Shake Smart is located inside the Recreation Center.\n</p>\n\n<p>\nThe philosophy at Shake Smart is simple: nutritious, delicious, affordable, and convenient. Shakes can be made vegan, vegetarian, gluten-free, and lactose-free being able to serve most types of dietary restrictions. Using organic ingredients wherever possible, and excluding any ice creams, frozen yogurts, purees, or artificial sweeteners, Shake Smart is the premier food option for college campuses. No matter what your lifestyle is fuel it with the proper nutrients. Shake Smart, Fuel Your Lifestyle. \n</p>\n',NULL),(79,' ','<p>Nutrient Rich & Delicious is what the NRICH Urban Market Express offers. Located inside the Global Center  Food Court (2nd floor), Nrich Express offers a variety of fresh pressed juices, ground nut butter, infused water, brewed tea & botanicals, probiotic rich frozen yogurt, and grab n\' go meals & snacks. Stop in for a health break!</p>',NULL),(80,' ','\n\n <h5 style=\'margin-bottom: 20px; padding-bottom: 6px; color: #ad6346; text-transform: uppercase; font-family: Arial Narrow,Arial,sans-serif; font-weight: 800; font-size: 1.4rem; border-bottom: 3px solid #ad6346;\'>Slot Canyon Caf&Eacute; is located inside the enr2 building on 6th street.</h5>\n  <p style=\"padding-bottom:15px; font-size: 1.2rem; line-height: 1.4rem; font-weight: 500;\">We\'re always serving coffee, lattes, cappuccinos, espresso, a variety of teas, and more.  You can pair our beverage options with our amazing selection of paninis, sandwiches, pastries, and protein rich snacks.\n  </p>\n\n \n  <link rel=\"stylesheet\" type=\"text/css\" href=\"/dining/template/lib/wallop/wallop.css\">\n  <link rel=\"stylesheet\" type=\"text/css\" href=\"/dining/template/lib/wallop/wallop--fade.css\">\n  <div class=\"Wallop Wallop--fade\">\n  	<div class=\"Wallop-list\">\n  		<div class=\"Wallop-item\">\n  			<img src=\"/dining/template/images/SlotCanyon/Slot_Canyon_Rotating_Slide1.jpg\" style=\"width:100%;\">\n  		</div>\n  		<div class=\"Wallop-item\">\n  			<img src=\"/dining/template/images/SlotCanyon/Slot_Canyon_Rotating_Slide2.jpg\" style=\"width:100%;\">\n  		</div>\n  		<div class=\"Wallop-item\">\n  			<img src=\"/dining/template/images/SlotCanyon/Slot_Canyon_Rotating_Slide3.jpg\" style=\"width:100%;\">\n  		</div>\n  	</div>\n  </div>\n  <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js\"></script>\n  <script src=\"/dining/template/lib/wallop/Wallop.min.js\"></script>\n  <script type=\"text/javascript\">\n  var wallopEl = document.querySelector(\'.Wallop\');\n  var slider = new Wallop(wallopEl);\n  autoplay(3000);\n  function autoplay(interval) {\n  	var lastTime = 0;  \n  	function frame(timestamp) {\n  		var update = timestamp - lastTime >= interval;\n  		if (update) {\n  			slider.next();\n  			lastTime = timestamp;\n  		}\n  		requestAnimationFrame(frame);\n  	}\n  	requestAnimationFrame(frame);\n  };\n  </script>\n \n',NULL),(81,' ','\r <p>Shake Smart specializes in freshly blended protein shakes, organic acai bowls, organic peanut butter and banana sandwiches, oatmeal, coldbrew coffee, whole wheat wraps, and kombucha on tap. A perfect option for before or after workouts, or for the college on-the-go lifestyle, Shake Smart was created by students, for students. Shake Smart is located inside the Recreation Center.</p> \r <p>&nbsp;</p>\r <p>The philosophy at Shake Smart is simple: nutritious, delicious, affordable, and convenient. Shakes can be made vegan, vegetarian, gluten-free, and lactose-free being able to serve most types of dietary restrictions. Using organic ingredients wherever possible, and excluding any ice creams, frozen yogurts, purees, or artificial sweeteners, Shake Smart is the premier food option for college campuses. No matter what your lifestyle is fuel it with the proper nutrients. Shake Smart, Fuel Your Lifestyle.</p> \r \r ',NULL),(82,'85 North is the newest dining experience at the University of Arizona. Settled inside the Honors Village residential hall, this all you care to eat buffet features a range of unique options.  ','<p>85 North is the newest dining experience at the University of Arizona. Located inside the Honors Village residential hall, this all-you-care-to eat buffet features a range of unique options. Grab a bite from our salad bar, featuring over 30 fresh ingredients. Build your own burger at our grill or pop over to our noodle & omelet station to customize your own pasta, ramen or omelet. Our pizza station features a rotating menu of classic and unique pizza options.<p> <br /><p>The International station includes cuisine from a variety of countries and cultures. During our dinner service, expect the Chefs pick of a slow roasted entree at our carving station. Hop over to our Veg Centric area, where you will find a rotating variety of vegetarian and vegan options handcrafted by our culinary team. Make sure you leave room for dessert, as our dessert bar includes frozen yogurt, various toppings, as well as a special treat picked daily. </p><br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. </strong></p> ',NULL),(49,'Administration',NULL,NULL),(83,'Authentic Mexican food including tacos, tamales and refreshing agua fresca','<p>Ms Tacos features authentic Mexican food including tacos with house made corn tortillas and salsa, delicious sides, salads and more. Grubhub pickup and delivery available. </p>   <br/><p><strong>Skip the line with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Express Pick Up</u></a>. Use your smartphone to order and pay ahead. <br />Save a trip with <a href=\"https://www.grubhub.com/about/campus\" target=\"_blank\" onMouseOver=\"this.style.color=\'#F58523\'\" onMouseOut=\"this.style.color=\'#E00A0D\'\"><u>GRUBHUB Delivery</u></a>. Use your smartphone to order, pay, and have your food taken directly to you. </strong></p> ',NULL),(84,'','',NULL),(85,'Located in Bear Down Gym 1st Floor.','Located in Bear Down Gym 1st Floor.  Red & Blue and Nrich house made favorites can be found here along with healthier snacks to fuel your studying or workout.  Enjoy Smart Tech Vending machines as well.',NULL);
